import './CSS/Login.css';
import Cookie from 'js-cookie';
import { useState, useEffect } from 'react';
import { authenticate } from './Utilities/Request';

export function signUp(){

    //_______________Authentication____________________

    async function Register(e){
        e.preventDefault();
        let Data = Object.fromEntries(new FormData(e.target).entries()); // get all field from Login form
        let response = await authenticate("Authenticate" , Data); // send login data to server

        //Set_Cookie_State(Cookie.set("tl-token" , val , {expires : result.exp})); // set expiration date

        alert(JSON.stringify(response))
    }


    return(<>

        <div class="container">

            {/*_______________Left Section__________________*/}

            <div class="left">
                RealTime To Do List
            </div>

            {/*_______________Right Section__________________*/}

            <div class="right">
                <div class="login-box">
                    <h2>Register New Account</h2>
                    <form onSubmit={Register}>

                        <label for="username">Name (FullName)</label>
                        <input type="text" name="username" placeholder="Enter username" required />

                        <label for="username">Username</label>
                        <input type="text" name="username" placeholder="Enter username" required />

                        <label for="username">Email Address</label>
                        <input type="text" name="email" placeholder="Enter username" required />

                        <label for="password">Password</label>
                        <input type="password" name="password" placeholder="Enter password" required/>

                        <label for="password">Re-Password</label>
                        <input type="password" name="repassword" placeholder="Enter password" required/>

                        <input type="submit" value= "Register and Enter" />

                    </form>
                </div>
            </div>
        </div>

    </>)
}
